css:
@-moz-document url-prefix("https://osrsbots.com/") {
.title-holder {
  align-items: center;
  background-color: #000;
  border-bottom: 4px solid #1e1e1e;
  border-top: 4px solid #1e1e1e;
  display: flex;
  justify-content: center;
  max-height: 15vh;
  min-height: 60px;
  width: 100%;
}
.home, .details {
  align-items: center;
  background: #1e1e1e;
  display: flex;
  flex-direction: column;
  height: 100vh;
  justify-content: flex-start;
  left: 0;
  right: 0;
  width: 100vw;
}
.title-holder {
  align-items: center;
  background-color: #1e1e1e;
  display: flex;
  justify-content: center;
  max-height: 15vh;
  min-height: 60px;
  width: 100%;
}
.nav-bar {
  background-color: #252525;
  border: 4px solid #000;
  box-shadow: 5px 10px 15px #453a85,inset 0 0 10px #453a85;
  display: block;
  height: 7.5vh;
  left: -1vw;
  min-height: 50px;
  position: relative;
  position: absolute;
  text-align: center;
  top: 87.5vh;
  -webkit-user-select: none;
  user-select: none;
  width: 110vw;
  z-index: 999;
}
.contact {
  background: #1e1e1e;
  height: 75vh;
}
button {
  background: #483d8b;
  border: 1px solid #505050;
  border-radius: 5px;
  color: #fff;
  font-family: Oswald,sans-serif;
  font-size: 2vh;
  font-weight: 800;
  height: 10vh;
  letter-spacing: 1px;
  -webkit-transform: scale(1);
  transform: scale(1);
  transition: -webkit-transform .25s linear;
  transition: transform .25s linear;
  transition: transform .25s linear,-webkit-transform .25s linear;
  width: 50%;
}
.discord-info-img {
  height: 3vh;
  width: 4vh;
  position: relative;
  top: 1vh;
  left: 2vh;
  color: white;
  content: url(https://assets-global.website-files.com/6257adef93867e50d84d30e2/636e0a6cc3c481a15a141738_icon_clyde_white_RGB.png);
}
.sub-title.desc {
  color: #fff;
  display: inline-block;
  -webkit-filter: blur(0);
  filter: blur(0);
  font-size: 2.5vh;
  letter-spacing: 2px;
  opacity: 1;
  transition: letter-spacing .5s ease,opacity .5s linear,-webkit-filter 1s ease;
  transition: filter 1s ease,letter-spacing .5s ease,opacity .5s linear;
  transition: filter 1s ease,letter-spacing .5s ease,opacity .5s linear,-webkit-filter 1s ease;
}
.runelite-link::before {
  background-color: #493e8b;
  -webkit-transform: scaleX(1);
  transform: scaleX(1);
}
.nav-link::after {
  background-color: #483d8b;
  bottom: 0;
  content: "";
  height: 2px;
  left: 0;
  margin-bottom: -2px;
  position: absolute;
  -webkit-transform: scaleX(0);
  transform: scaleX(0);
  -webkit-transform-origin: bottom right;
  transform-origin: bottom right;
  transition: -webkit-transform .25s ease-out;
  transition: transform .25s ease-out;
  transition: transform .25s ease-out,-webkit-transform .25s ease-out;
  width: 100%;
}
.card-title {
  background-color: #483d8b;
  border-bottom: 1px solid #504690;
  border-radius: 5px 5px 0 0;
  height: 5vh;
  letter-spacing: 1px;
}
.nav-content {
  align-items: center;
  display: flex;
  flex-direction: row;
  height: 100%;
  justify-content: space-evenly;
  text-align: center;
  width: 53%;
  left: 50%;
  margin-left: 18%;
}
.nav-bar {
  background-color: #252525ab;
}
.details-txt-cycle {
  height: 25vh;
  opacity: 1;
  transition: all .25s linear;
}
.discord-holder {
  background-color: #252525;
  border: 1px solid #483d8b;
  border-radius: 5px;
  height: 100%;
  width: 100%;
}
.home-img-content {
  max-width: min(200vw,200vh);
}
}
